import styled from "styled-components";
import CropFreeIcon from "@material-ui/icons/CropFree";

export const StyledCropFreeIcon = styled(CropFreeIcon)`
  font-size: 64px;
`;

export const Container = styled.div`
  display: flex;
  flex-direction: column;
  min-height: 100vh;
  align-items: center;
`;

export const Main = styled.div`
  display: flex;
  flex-direction: column;
  width: 100%;
  max-width: 300px;
  min-height: 40vh;
  align-items: center;
  justify-content: center;
  color: #363535;
  background: #fff;
  border-radius: 10px;
  margin-top: 100px;
  font-size: 64px;
`;

export const Phrase = styled.div`
  font-family: "Roboto";
  font-size: 25px;
  max-width: 150px;
  margin-top: 40px;
`;
